func abcd() {
	rep := make(map[string]int)
	newList := []genesis.DeployAccount{}
	cnt := 0
	for id, item := range GenesisFNAccounts {
		address := item.Address
		if address[0] == '0' && address[1] == 'x' {
			address = common2.MustAddressToBech32(ethCommon.HexToAddress(address))
		}
		item.Address = address
		if id <= 98 {
			item.Updated = "coded"
		} else {
			item.Updated = "from sheet"
		}
		if rep[address] == 0 {
			// item.Updated = "from foundational.go"
			item.Index = strconv.Itoa(cnt)
			cnt++
			newList = append(newList, item)
			if len(item.BlsPublicKey) != 96 {
				item.Updated = "bls wrong length"
			}
			rep[address] = len(newList)
		} else {
			idx := rep[address] - 1
			// newList[idx].Updated = "updated from sheet"
			fmt.Println("testing ", item.BlsPublicKey)
			pub := &bls.PublicKey{}
			if len(item.BlsPublicKey) == 96 && pub.DeserializeHexStr(item.BlsPublicKey) == nil {
				newList[idx].BlsPublicKey = item.BlsPublicKey
				newList[idx].Updated = "overwritten from sheet"
			}
		}
	}
	for _, item := range newList {
		fmt.Printf("{Index: \"%s\", Address: \"%s\", BlsPriKey: \"%s\", BlsPublicKey: \"%s\", Updated: \"%s\"},\n",
			item.Index, item.Address, item.BlsPriKey, item.BlsPublicKey, item.Updated)
		// fmt.Printf("{Index: \"%s\", Address: \"%s\", BlsPriKey: \"%s\", BlsPublicKey: \"%s\"},\n",
		// 	item.Index, item.Address, item.BlsPriKey, item.BlsPublicKey)
	}
}

func main() {
	abcd()
}
